<!DOCTYPE html>
<html class="bg-grey-lightest" lang="en">
<head>
    <script>
        if ('serviceWorker' in navigator) {
            navigator.serviceWorker.getRegistrations().then(function (registrations) {
                if (registrations.length) {
                    for(let registration of registrations) {
                        registration.unregister().then(() => {
                        window.location.reload();
                        });
                    }
                }
            });
        }
    </script>
    <meta charset="utf-8">
    <meta http-equiv="x-ua-compatible" content="ie=edge">

    <meta property="og:image" content="https://lh3.googleusercontent.com/K--YJQWc3tcTagp7wN-3QW7hChq0oUDWok51iun3oejLXD59XiQ5Bc_chmnZWXA9DCcSdIQbTZZ0tVU2c5NdIZWPiX5RzlDaRhGD_0y13sY1PAd4X1TKCWy-FLVs77oI9mzWGLXWWA=w800" />
    <meta property="og:type" content="website" />
    <meta property="og:title" content="CIGMAH - The Coding Interest Group in Medicine and Healthcare" />
    <meta property="og:description" content="A student group based at Monash University interested in applying coding to bench and clinical medicine." />
    <link href="https://fonts.googleapis.com/css?family=Space+Mono:400,700" rel="stylesheet">
    <link rel="stylesheet" href="https://use.fontawesome.com/releases/v5.7.0/css/all.css" integrity="sha384-lZN37f5QGtY3VHgisS14W3ExzMWZxybE1SJSEsQp9S+oqd12jhcu+A56Ebc1zFSJ" crossorigin="anonymous">

    <title>CIGMAH</title>
</head>
